import React from "react";
import { StyleSheet, Text, View } from "react-native";
const styles = StyleSheet.create({
    container: {

        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
        width:'100%',
        height:'100%',
        //margin left and right
        marginLeft: '30px',
        marginRight: '30px',
    },
    input: {
        height: 40,
        margin: 12,
        borderWidth: 1,
        width:'100%',
        height:'100%',
    },
});
export default styles;
